(1, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"typer_color\":null,\"text_color\":null,\"button_bg_color\":null,\"button_text_color\":null,\"section_title\":{\"en\":\"Powerful software to\",\"ger\":\"Leistungsstarke Software zu\",\"fr\":\"Un logiciel puissant pour\",\"tr\":\"G\\u00fc\\u00e7l\\u00fc yaz\\u0131l\\u0131m\",\"pt\":\"Software poderoso para\",\"ar\":\"\\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0634\\u062d\\u0646 \\u0642\\u0648\\u064a \\u0625\\u0644\\u0649\",\"bn\":\"\\u09b6\\u0995\\u09cd\\u09a4\\u09bf\\u09b6\\u09be\\u09b2\\u09c0 \\u09b8\\u09ab\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0 \\u09a5\\u09c7\\u0995\\u09c7\",\"ru\":\"\\u041c\\u043e\\u0449\\u043d\\u043e\\u0435 \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u043d\\u043e\\u0435 \\u043e\\u0431\\u0435\\u0441\\u043f\\u0435\\u0447\\u0435\\u043d\\u0438\\u0435 \\u0434\\u043b\\u044f\",\"es\":\"Potente software para\",\"zh\":\"\\u529f\\u80fd\\u5f3a\\u5927\\u7684\\u8f6f\\u4ef6\"},\"section_subtitle1\":{\"en\":\"Grow internationally\",\"ger\":\"International wachsen\",\"fr\":\"Se d\\u00e9velopper \\u00e0 l\'international\",\"tr\":\"Uluslararas\\u0131 b\\u00fcy\\u00fcmek\",\"pt\":\"Crescer internacionalmente\",\"ar\":\"\\u062a\\u0646\\u0645\\u0648 \\u062f\\u0648\\u0644\\u064a\\u0627\",\"bn\":\"\\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995\\u09ad\\u09be\\u09ac\\u09c7 \\u09ac\\u09c3\\u09a6\\u09cd\\u09a7\\u09bf\",\"ru\":\"\\u0420\\u0430\\u0441\\u0442\\u0438 \\u043d\\u0430 \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u043e\\u043c \\u0443\\u0440\\u043e\\u0432\\u043d\\u0435\",\"es\":\"Crecer internacionalmente\",\"zh\":\"\\u56fd\\u9645\\u5316\\u53d1\\u5c55\"},\"section_subtitle2\":{\"en\":\"Save time\",\"ger\":\"Zeit sparen\",\"fr\":\"Gagner du temps\",\"tr\":\"Zamandan tasarruf\",\"pt\":\"Economizar tempo\",\"ar\":\"\\u062a\\u0648\\u0641\\u0631 \\u0627\\u0644\\u0648\\u0642\\u062a\",\"bn\":\"\\u09b8\\u09ae\\u09af\\u09bc \\u09ac\\u09be\\u0981\\u099a\\u09be\\u09a4\\u09c7\",\"ru\":\"\\u042d\\u043a\\u043e\\u043d\\u043e\\u043c\\u044c\\u0442\\u0435 \\u0432\\u0440\\u0435\\u043c\\u044f\",\"es\":\"Ahorrar tiempo\",\"zh\":\"\\u7701\\u65f6\\u95f4\"},\"section_subtitle3\":{\"en\":\"Delight Customers\",\"ger\":\"Kunden begeistern\",\"fr\":\"Ravir les clients\",\"tr\":\"M\\u00fc\\u015fterileri Memnun Etme\",\"pt\":\"Encantar os clientes\",\"ar\":\"\\u062a\\u0633\\u0639\\u062f \\u0639\\u0645\\u0644\\u0627\\u0626\\u0643\",\"bn\":\"\\u0996\\u09c1\\u09b6\\u09bf \\u0997\\u09cd\\u09b0\\u09be\\u09b9\\u0995\\u09a6\\u09c7\\u09b0\",\"ru\":\"\\u0412\\u043e\\u0441\\u0442\\u043e\\u0440\\u0433 \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u043e\\u0432\",\"es\":\"deleitar a los clientes\",\"zh\":\"\\u53d6\\u60a6\\u5ba2\\u6237\"},\"section_description\":{\"en\":\"The cargo shipping software of choice for growing businesses. Get the lowest rates with a shipping and tracking experience customers love.\",\"ger\":\"Die Frachtversandsoftware der Wahl f\\u00fcr wachsende Unternehmen. Erhalten Sie die niedrigsten Preise mit einem Versand- und Tracking-Erlebnis, das Kunden lieben.\",\"fr\":\"Le logiciel d\'exp\\u00e9dition de fret de choix pour les entreprises en croissance. Obtenez les tarifs les plus bas avec une exp\\u00e9rience d\'exp\\u00e9dition et de suivi que les clients adorent.\",\"tr\":\"B\\u00fcy\\u00fcyen i\\u015fletmeler i\\u00e7in tercih edilen kargo nakliye yaz\\u0131l\\u0131m\\u0131. M\\u00fc\\u015fterilerin sevdi\\u011fi bir nakliye ve takip deneyimiyle en d\\u00fc\\u015f\\u00fck fiyatlar\\u0131 al\\u0131n.\",\"pt\":\"O software de transporte de carga de escolha para empresas em crescimento. Obtenha as taxas mais baixas com uma experi\\u00eancia de envio e rastreamento que os clientes adoram.\",\"ar\":\"\\u0628\\u0631\\u0646\\u0627\\u0645\\u062c \\u0643\\u0627\\u0631\\u062c\\u0648 \\u0644\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u0641\\u0636\\u0644 \\u0644\\u0644\\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0645\\u062a\\u0646\\u0627\\u0645\\u064a\\u0629. \\u0627\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0623\\u0642\\u0644 \\u0627\\u0644\\u0623\\u0633\\u0639\\u0627\\u0631 \\u0645\\u0639 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u062a\\u062c\\u0631\\u0628\\u0629 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0648\\u0627\\u0644\\u062a\\u062a\\u0628\\u0639 \\u0627\\u0644\\u062a\\u064a \\u064a\\u062d\\u0628\\u0647\\u0627 \\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621.\",\"bn\":\"\\u0995\\u09cd\\u09b0\\u09ae\\u09ac\\u09b0\\u09cd\\u09a7\\u09ae\\u09be\\u09a8 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u09aa\\u099b\\u09a8\\u09cd\\u09a6\\u09c7\\u09b0 \\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09ab\\u09cd\\u099f\\u0993\\u09af\\u09bc\\u09cd\\u09af\\u09be\\u09b0\\u0964 \\u098f\\u0995\\u099f\\u09bf \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u098f\\u09ac\\u0982 \\u099f\\u09cd\\u09b0\\u09cd\\u09af\\u09be\\u0995\\u09bf\\u0982 \\u0985\\u09ad\\u09bf\\u099c\\u09cd\\u099e\\u09a4\\u09be \\u0997\\u09cd\\u09b0\\u09be\\u09b9\\u0995\\u09a6\\u09c7\\u09b0 \\u09aa\\u099b\\u09a8\\u09cd\\u09a6 \\u09b8\\u0999\\u09cd\\u0997\\u09c7 \\u09b8\\u09b0\\u09cd\\u09ac\\u09a8\\u09bf\\u09ae\\u09cd\\u09a8 \\u09b9\\u09be\\u09b0 \\u09aa\\u09be\\u09a8.\",\"ru\":\"\\u041b\\u0443\\u0447\\u0448\\u0435\\u0435 \\u043f\\u0440\\u043e\\u0433\\u0440\\u0430\\u043c\\u043c\\u043d\\u043e\\u0435 \\u043e\\u0431\\u0435\\u0441\\u043f\\u0435\\u0447\\u0435\\u043d\\u0438\\u0435 \\u0434\\u043b\\u044f \\u0433\\u0440\\u0443\\u0437\\u043e\\u043f\\u0435\\u0440\\u0435\\u0432\\u043e\\u0437\\u043e\\u043a \\u0434\\u043b\\u044f \\u0440\\u0430\\u0441\\u0442\\u0443\\u0449\\u0435\\u0433\\u043e \\u0431\\u0438\\u0437\\u043d\\u0435\\u0441\\u0430. \\u041f\\u043e\\u043b\\u0443\\u0447\\u0438\\u0442\\u0435 \\u0441\\u0430\\u043c\\u044b\\u0435 \\u043d\\u0438\\u0437\\u043a\\u0438\\u0435 \\u0442\\u0430\\u0440\\u0438\\u0444\\u044b \\u0441 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u043e\\u0439 \\u0438 \\u043e\\u0442\\u0441\\u043b\\u0435\\u0436\\u0438\\u0432\\u0430\\u043d\\u0438\\u0435\\u043c, \\u043a\\u043e\\u0442\\u043e\\u0440\\u044b\\u0435 \\u043d\\u0440\\u0430\\u0432\\u044f\\u0442\\u0441\\u044f \\u043a\\u043b\\u0438\\u0435\\u043d\\u0442\\u0430\\u043c.\",\"es\":\"El software de env\\u00edo de carga de elecci\\u00f3n para las empresas en crecimiento. Obtenga las tarifas m\\u00e1s bajas con una experiencia de env\\u00edo y seguimiento que los clientes adoran.\",\"zh\":\"\\u6210\\u957f\\u578b\\u4f01\\u4e1a\\u7684\\u9996\\u9009\\u8d27\\u8fd0\\u8f6f\\u4ef6\\u3002 \\u901a\\u8fc7\\u5ba2\\u6237\\u559c\\u7231\\u7684\\u8fd0\\u8f93\\u548c\\u8ddf\\u8e2a\\u4f53\\u9a8c\\u83b7\\u5f97\\u6700\\u4f4e\\u4ef7\\u683c\\u3002\"},\"section_button\":{\"en\":\"Get started\",\"ger\":\"Loslegen\",\"fr\":\"Commencer\",\"tr\":\"Ba\\u015flamak\",\"pt\":\"iniciar\",\"ar\":\"\\u0623\\u0628\\u062f\\u0623 \\u0645\\u0639\\u0646\\u0627\",\"bn\":\"\\u098f\\u09ac\\u09be\\u09b0 \\u09b6\\u09c1\\u09b0\\u09c1 \\u0995\\u09b0\\u09be \\u09af\\u09be\\u0995\",\"ru\":\"\\u041d\\u0430\\u0447\\u0430\\u0442\\u044c\",\"es\":\"Empezar\",\"zh\":\"\\u5f00\\u59cb\\u4f7f\\u7528\"},\"section_url\":{\"type\":\"custom\",\"custom\":\"#\",\"page\":null,\"category\":null,\"post\":null}}', 'hero', 'homepage', NULL, 14, 'easyship', 1, '2022-04-28 12:04:17', '2022-06-13 13:31:37'),
