(5, 1, '{\"display\":true,\"header_bg\":null,\"text_color\":null,\"section_title\":{\"en\":\"Supercharge Your Shipping. Grow Your eCommerce Business.\",\"ger\":\"Laden Sie Ihren Versand auf. Bauen Sie Ihr E-Commerce-Gesch\\u00e4ft aus.\",\"fr\":\"Boostez votre exp\\u00e9dition. D\\u00e9veloppez votre entreprise de commerce \\u00e9lectronique.\",\"tr\":\"G\\u00f6nderinizi G\\u00fc\\u00e7lendirin. E-Ticaret \\u0130\\u015finizi B\\u00fcy\\u00fct\\u00fcn.\",\"pt\":\"Sobrecarregue seu envio. Expanda seu neg\\u00f3cio de com\\u00e9rcio eletr\\u00f4nico.\",\"ar\":\"\\u0627\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0622\\u0646. \\u0648\\u0627\\u0639\\u0645\\u0644 \\u0639\\u0644\\u0649 \\u062a\\u0646\\u0645\\u064a\\u0629 \\u0623\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b8\\u09c1\\u09aa\\u09be\\u09b0\\u099a\\u09be\\u09b0\\u09cd\\u099c. \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u0987\\u0995\\u09ae\\u09be\\u09b0\\u09cd\\u09b8 \\u09ac\\u09cd\\u09af\\u09ac\\u09b8\\u09be \\u09ac\\u09be\\u09a1\\u09bc\\u09be\\u09a8.\",\"ru\":\"\\u041f\\u0435\\u0440\\u0435\\u0437\\u0430\\u0433\\u0440\\u0443\\u0437\\u0438\\u0442\\u0435 \\u0432\\u0430\\u0448\\u0443 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443. \\u0420\\u0430\\u0437\\u0432\\u0438\\u0432\\u0430\\u0439\\u0442\\u0435 \\u0441\\u0432\\u043e\\u0439 \\u0431\\u0438\\u0437\\u043d\\u0435\\u0441 \\u044d\\u043b\\u0435\\u043a\\u0442\\u0440\\u043e\\u043d\\u043d\\u043e\\u0439 \\u043a\\u043e\\u043c\\u043c\\u0435\\u0440\\u0446\\u0438\\u0438.\",\"es\":\"Potencie su env\\u00edo. Haga crecer su negocio de comercio electr\\u00f3nico.\",\"zh\":\"\\u589e\\u538b\\u60a8\\u7684\\u8fd0\\u8f93\\u3002 \\u53d1\\u5c55\\u60a8\\u7684\\u7535\\u5b50\\u5546\\u52a1\\u4e1a\\u52a1\\u3002\"}}', 'headline', 'homepage', NULL, 15, 'easyship', 1, '2022-04-28 15:45:16', '2022-06-13 14:16:59'),
(6, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"The Cheapest Shipping Rates, Guaranteed\",\"ger\":\"Die g\\u00fcnstigsten Versandkosten, garantiert\",\"fr\":\"Les tarifs d\'exp\\u00e9dition les moins chers, garantis\",\"tr\":\"En Ucuz Nakliye Fiyatlar\\u0131, Garantili\",\"pt\":\"As taxas de envio mais baratas, garantidas\",\"ar\":\"\\u0623\\u0631\\u062e\\u0635 \\u0623\\u0633\\u0639\\u0627\\u0631 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u0636\\u0645\\u0648\\u0646\\u0629\",\"bn\":\"\\u09b8\\u09ac\\u099a\\u09c7\\u09af\\u09bc\\u09c7 \\u09b8\\u09b8\\u09cd\\u09a4\\u09be \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b0\\u09c7\\u099f, \\u0997\\u09cd\\u09af\\u09be\\u09b0\\u09be\\u09a8\\u09cd\\u099f\\u09bf\\u09af\\u09c1\\u0995\\u09cd\\u09a4\",\"ru\":\"\\u0421\\u0430\\u043c\\u044b\\u0435 \\u0434\\u0435\\u0448\\u0435\\u0432\\u044b\\u0435 \\u0442\\u0430\\u0440\\u0438\\u0444\\u044b \\u043d\\u0430 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443, \\u0433\\u0430\\u0440\\u0430\\u043d\\u0442\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u043d\\u044b\\u0435\",\"es\":\"Las tarifas de env\\u00edo m\\u00e1s econ\\u00f3micas, garantizadas\",\"zh\":\"\\u4fdd\\u8bc1\\u6700\\u4fbf\\u5b9c\\u7684\\u8fd0\\u8d39\"},\"section_description\":{\"en\":\"Stop overpaying for shipping. Our rates remain unbeaten and are available to everybody. See how you can save up to 89% on top couriers. With 250+ courier services from USPS, UPS, DHL and more, we have the right courier for your needs. See available couriers and shipping rates.\",\"ger\":\"H\\u00f6ren Sie auf, f\\u00fcr den Versand zu viel zu bezahlen. Unsere Preise bleiben ungeschlagen und stehen allen zur Verf\\u00fcgung. Sehen Sie, wie Sie bis zu 89 % bei den besten Kurieren sparen k\\u00f6nnen. Mit \\u00fcber 250 Kurierdiensten von USPS, UPS, DHL und mehr haben wir den richtigen Kurier f\\u00fcr Ihre Bed\\u00fcrfnisse. Siehe verf\\u00fcgbare Kuriere und Versandkosten.\",\"fr\":\"Arr\\u00eatez de payer trop cher pour l\'exp\\u00e9dition. Nos tarifs restent in\\u00e9gal\\u00e9s et sont accessibles \\u00e0 tous. D\\u00e9couvrez comment vous pouvez \\u00e9conomiser jusqu\'\\u00e0 89\\u00a0% sur les meilleurs coursiers. Avec plus de 250 services de messagerie d\'USPS, UPS, DHL et plus, nous avons le bon service de messagerie pour vos besoins. Voir les coursiers disponibles et les tarifs d\'exp\\u00e9dition.\",\"tr\":\"Nakliye i\\u00e7in fazla \\u00f6deme yapmay\\u0131 b\\u0131rak\\u0131n. Oranlar\\u0131m\\u0131z rakipsizdir ve herkes taraf\\u0131ndan kullan\\u0131labilir. En iyi kuryelerde nas\\u0131l %89\'a kadar tasarruf edebilece\\u011finizi g\\u00f6r\\u00fcn. USPS, UPS, DHL ve daha fazlas\\u0131ndan 250\'den fazla kurye hizmeti ile ihtiya\\u00e7lar\\u0131n\\u0131z i\\u00e7in do\\u011fru kuryeye sahibiz. Mevcut kuryeleri ve nakliye \\u00fccretlerini g\\u00f6r\\u00fcn.\",\"pt\":\"Pare de pagar caro pelo frete. Nossas taxas permanecem imbat\\u00edveis e est\\u00e3o dispon\\u00edveis para todos. Veja como voc\\u00ea pode economizar at\\u00e9 89% nos melhores entregadores. Com mais de 250 servi\\u00e7os de correio da USPS, UPS, DHL e muito mais, temos o correio certo para suas necessidades. Consulte os correios dispon\\u00edveis e as taxas de envio.\",\"ar\":\"\\u062a\\u0648\\u0642\\u0641 \\u0639\\u0646 \\u062f\\u0641\\u0639 \\u0645\\u0628\\u0627\\u0644\\u063a \\u0632\\u0627\\u0626\\u062f\\u0629 \\u0644\\u0644\\u0634\\u062d\\u0646. \\u0623\\u0633\\u0639\\u0627\\u0631\\u0646\\u0627 \\u0644\\u0627 \\u062a\\u0647\\u0632\\u0645 \\u0648\\u0645\\u062a\\u0627\\u062d\\u0629 \\u0644\\u0644\\u062c\\u0645\\u064a\\u0639. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062a\\u0648\\u0641\\u064a\\u0631 \\u0645\\u0627 \\u064a\\u0635\\u0644 \\u0625\\u0644\\u0649 89\\u066a \\u0639\\u0644\\u0649 \\u0623\\u0641\\u0636\\u0644 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644. \\u0645\\u0639 \\u0623\\u0643\\u062b\\u0631 \\u0645\\u0646 250 \\u062e\\u062f\\u0645\\u0629 \\u0628\\u0631\\u064a\\u062f \\u0633\\u0631\\u064a\\u0639 \\u0645\\u0646 USPS \\u0648 UPS \\u0648 DHL \\u0648\\u063a\\u064a\\u0631\\u0647\\u0627 \\u060c \\u0644\\u062f\\u064a\\u0646\\u0627 \\u0627\\u0644\\u0628\\u0631\\u064a\\u062f \\u0627\\u0644\\u0633\\u0631\\u064a\\u0639 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628 \\u0644\\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a\\u0643. \\u0627\\u0646\\u0638\\u0631 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0627\\u062d\\u0629 \\u0648\\u0623\\u0633\\u0639\\u0627\\u0631 \\u0627\\u0644\\u0634\\u062d\\u0646.\",\"bn\":\"\\u09b6\\u09bf\\u09aa\\u09bf\\u0982\\u09af\\u09bc\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0985\\u09a4\\u09bf\\u09b0\\u09bf\\u0995\\u09cd\\u09a4 \\u0985\\u09b0\\u09cd\\u09a5 \\u09aa\\u09cd\\u09b0\\u09a6\\u09be\\u09a8 \\u09ac\\u09a8\\u09cd\\u09a7 \\u0995\\u09b0\\u09c1\\u09a8\\u0964 \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u09b9\\u09be\\u09b0 \\u0985\\u09aa\\u09b0\\u09be\\u099c\\u09bf\\u09a4 \\u09a5\\u09be\\u0995\\u09c7 \\u098f\\u09ac\\u0982 \\u09aa\\u09cd\\u09b0\\u09a4\\u09cd\\u09af\\u09c7\\u0995\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0989\\u09aa\\u09b2\\u09ac\\u09cd\\u09a7\\u0964 \\u09a6\\u09c7\\u0996\\u09c1\\u09a8 \\u0995\\u09bf\\u09ad\\u09be\\u09ac\\u09c7 \\u0986\\u09aa\\u09a8\\u09bf \\u09b6\\u09c0\\u09b0\\u09cd\\u09b7 \\u0995\\u09c1\\u09b0\\u09bf\\u09af\\u09bc\\u09be\\u09b0\\u0997\\u09c1\\u09b2\\u09bf\\u09a4\\u09c7 89% \\u09aa\\u09b0\\u09cd\\u09af\\u09a8\\u09cd\\u09a4 \\u09b8\\u0982\\u09b0\\u0995\\u09cd\\u09b7\\u09a3 \\u0995\\u09b0\\u09a4\\u09c7 \\u09aa\\u09be\\u09b0\\u09c7\\u09a8\\u0964 USPS, UPS, DHL \\u098f\\u09ac\\u0982 \\u0986\\u09b0\\u0993 \\u0985\\u09a8\\u09c7\\u0995 \\u0995\\u09bf\\u099b\\u09c1 \\u09a5\\u09c7\\u0995\\u09c7 250+ \\u0995\\u09c1\\u09b0\\u09bf\\u09af\\u09bc\\u09be\\u09b0 \\u09aa\\u09b0\\u09bf\\u09b7\\u09c7\\u09ac\\u09be \\u09b8\\u09b9, \\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09aa\\u09cd\\u09b0\\u09af\\u09bc\\u09cb\\u099c\\u09a8\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u0986\\u09ae\\u09be\\u09a6\\u09c7\\u09b0 \\u0995\\u09be\\u099b\\u09c7 \\u09b8\\u09a0\\u09bf\\u0995 \\u0995\\u09c1\\u09b0\\u09bf\\u09af\\u09bc\\u09be\\u09b0 \\u09b0\\u09af\\u09bc\\u09c7\\u099b\\u09c7\\u0964 \\u0989\\u09aa\\u09b2\\u09ac\\u09cd\\u09a7 \\u0995\\u09c1\\u09b0\\u09bf\\u09af\\u09bc\\u09be\\u09b0 \\u098f\\u09ac\\u0982 \\u09b6\\u09bf\\u09aa\\u09bf\\u0982 \\u09b9\\u09be\\u09b0 \\u09a6\\u09c7\\u0996\\u09c1\\u09a8.\",\"ru\":\"\\u0425\\u0432\\u0430\\u0442\\u0438\\u0442 \\u043f\\u0435\\u0440\\u0435\\u043f\\u043b\\u0430\\u0447\\u0438\\u0432\\u0430\\u0442\\u044c \\u0437\\u0430 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443. \\u041d\\u0430\\u0448\\u0438 \\u0442\\u0430\\u0440\\u0438\\u0444\\u044b \\u043e\\u0441\\u0442\\u0430\\u044e\\u0442\\u0441\\u044f \\u043d\\u0435\\u043f\\u0440\\u0435\\u0432\\u0437\\u043e\\u0439\\u0434\\u0435\\u043d\\u043d\\u044b\\u043c\\u0438 \\u0438 \\u0434\\u043e\\u0441\\u0442\\u0443\\u043f\\u043d\\u044b \\u043a\\u0430\\u0436\\u0434\\u043e\\u043c\\u0443. \\u041f\\u043e\\u0441\\u043c\\u043e\\u0442\\u0440\\u0438\\u0442\\u0435, \\u043a\\u0430\\u043a \\u0432\\u044b \\u043c\\u043e\\u0436\\u0435\\u0442\\u0435 \\u0441\\u044d\\u043a\\u043e\\u043d\\u043e\\u043c\\u0438\\u0442\\u044c \\u0434\\u043e 89% \\u043d\\u0430 \\u043b\\u0443\\u0447\\u0448\\u0438\\u0445 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440\\u0430\\u0445. \\u0418\\u043c\\u0435\\u044f \\u0431\\u043e\\u043b\\u0435\\u0435 250 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440\\u0441\\u043a\\u0438\\u0445 \\u0441\\u043b\\u0443\\u0436\\u0431 \\u043e\\u0442 USPS, UPS, DHL \\u0438 \\u0434\\u0440\\u0443\\u0433\\u0438\\u0445, \\u0443 \\u043d\\u0430\\u0441 \\u0435\\u0441\\u0442\\u044c \\u043f\\u043e\\u0434\\u0445\\u043e\\u0434\\u044f\\u0449\\u0438\\u0439 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440 \\u0434\\u043b\\u044f \\u0432\\u0430\\u0448\\u0438\\u0445 \\u043d\\u0443\\u0436\\u0434. \\u041f\\u043e\\u0441\\u043c\\u043e\\u0442\\u0440\\u0435\\u0442\\u044c \\u0434\\u043e\\u0441\\u0442\\u0443\\u043f\\u043d\\u044b\\u0435 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440\\u044b \\u0438 \\u0442\\u0430\\u0440\\u0438\\u0444\\u044b \\u043d\\u0430 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0443.\",\"es\":\"Deja de pagar de m\\u00e1s por el env\\u00edo. Nuestras tarifas siguen siendo imbatibles y est\\u00e1n disponibles para todos. Vea c\\u00f3mo puede ahorrar hasta un 89 % en los principales servicios de mensajer\\u00eda. Con m\\u00e1s de 250 servicios de mensajer\\u00eda de USPS, UPS, DHL y m\\u00e1s, tenemos el servicio de mensajer\\u00eda adecuado para sus necesidades. Consulte los servicios de mensajer\\u00eda disponibles y las tarifas de env\\u00edo.\",\"zh\":\"\\u505c\\u6b62\\u591a\\u4ed8\\u8fd0\\u8d39\\u3002 \\u6211\\u4eec\\u7684\\u5229\\u7387\\u4fdd\\u6301\\u4e0d\\u8d25\\uff0c\\u6240\\u6709\\u4eba\\u90fd\\u53ef\\u4ee5\\u4f7f\\u7528\\u3002 \\u4e86\\u89e3\\u5982\\u4f55\\u5728\\u9876\\u7ea7\\u5feb\\u9012\\u4e0a\\u8282\\u7701\\u9ad8\\u8fbe 89% \\u7684\\u8d39\\u7528\\u3002 \\u51ed\\u501f\\u6765\\u81ea USPS\\u3001UPS\\u3001DHL \\u7b49\\u7684 250 \\u591a\\u79cd\\u5feb\\u9012\\u670d\\u52a1\\uff0c\\u6211\\u4eec\\u6709\\u9002\\u5408\\u60a8\\u9700\\u6c42\\u7684\\u5feb\\u9012\\u670d\\u52a1\\u3002 \\u67e5\\u770b\\u53ef\\u7528\\u7684\\u5feb\\u9012\\u516c\\u53f8\\u548c\\u8fd0\\u8d39\\u3002\"}}', 'info', 'homepage', NULL, 15, 'easyship', 2, '2022-04-28 15:47:13', '2022-06-13 13:31:37'),
(7, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"end\",\"section_title\":{\"en\":\"Unlock Global Growth\",\"ger\":\"Schalten Sie globales Wachstum frei\",\"fr\":\"Lib\\u00e9rez la croissance mondiale\",\"tr\":\"K\\u00fcresel B\\u00fcy\\u00fcmenin Kilidini A\\u00e7\\u0131n\",\"pt\":\"Desbloqueie o crescimento global\",\"ar\":\"\\u0623\\u0637\\u0644\\u0642 \\u0627\\u0644\\u0639\\u0646\\u0627\\u0646 \\u0644\\u0644\\u0646\\u0645\\u0648 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\",\"bn\":\"\\u0997\\u09cd\\u09b2\\u09cb\\u09ac\\u09be\\u09b2 \\u0997\\u09cd\\u09b0\\u09cb\\u09a5 \\u0986\\u09a8\\u09b2\\u0995 \\u0995\\u09b0\\u09c1\\u09a8\",\"ru\":\"\\u041e\\u0442\\u043a\\u0440\\u043e\\u0439\\u0442\\u0435 \\u0433\\u043b\\u043e\\u0431\\u0430\\u043b\\u044c\\u043d\\u044b\\u0439 \\u0440\\u043e\\u0441\\u0442\",\"es\":\"Desbloquee el crecimiento global\",\"zh\":\"\\u89e3\\u9501\\u5168\\u7403\\u589e\\u957f\"},\"section_description\":{\"en\":\"Boost revenue by selling worldwide, seamlessly. Cargo does the hard work by integrating with leading international couriers, calculating tax and duty costs and preparing the right paperwork for smooth customs clearance and delivery. Learn how Cargo handles customs clearance.\",\"ger\":\"Steigern Sie den Umsatz, indem Sie nahtlos weltweit verkaufen. Cargo erledigt die harte Arbeit, indem es sich mit f\\u00fchrenden internationalen Kurieren zusammenschlie\\u00dft, Steuer- und Zollkosten berechnet und die richtigen Unterlagen f\\u00fcr eine reibungslose Zollabfertigung und Lieferung vorbereitet. Erfahren Sie, wie Cargo die Zollabfertigung abwickelt.\",\"fr\":\"Augmentez vos revenus en vendant dans le monde entier, de mani\\u00e8re transparente. Cargo fait le travail acharn\\u00e9 en s\'int\\u00e9grant aux principaux coursiers internationaux, en calculant les co\\u00fbts des taxes et des droits et en pr\\u00e9parant les bons documents pour un d\\u00e9douanement et une livraison fluides. D\\u00e9couvrez comment Cargo g\\u00e8re le d\\u00e9douanement.\",\"tr\":\"D\\u00fcnya \\u00e7ap\\u0131nda sorunsuz bir \\u015fekilde sat\\u0131\\u015f yaparak gelirinizi art\\u0131r\\u0131n. Kargo, \\u00f6nde gelen uluslararas\\u0131 kuryelerle entegre olarak, vergi ve har\\u00e7 maliyetlerini hesaplayarak ve sorunsuz g\\u00fcmr\\u00fckleme ve teslimat i\\u00e7in do\\u011fru evraklar\\u0131 haz\\u0131rlayarak zor i\\u015fi yapar. Cargo\'nun g\\u00fcmr\\u00fck i\\u015flemlerini nas\\u0131l y\\u00fcr\\u00fctt\\u00fc\\u011f\\u00fcn\\u00fc \\u00f6\\u011frenin.\",\"pt\":\"Aumente a receita vendendo em todo o mundo, sem problemas. A Cargo faz o trabalho \\u00e1rduo integrando-se com os principais correios internacionais, calculando os custos de impostos e taxas e preparando a documenta\\u00e7\\u00e3o certa para um desembara\\u00e7o aduaneiro e entrega tranquilos. Saiba como a Cargo trata do desembara\\u00e7o aduaneiro.\",\"ar\":\"\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0627\\u0644\\u0625\\u064a\\u0631\\u0627\\u062f\\u0627\\u062a \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0627\\u0644\\u0628\\u064a\\u0639 \\u0628\\u0633\\u0644\\u0627\\u0633\\u0629 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u062d\\u0627\\u0621 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645. \\u062a\\u0642\\u0648\\u0645 Cargo \\u0628\\u0627\\u0644\\u0639\\u0645\\u0644 \\u0627\\u0644\\u0634\\u0627\\u0642 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u062f\\u0645\\u062c \\u0645\\u0639 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0631\\u0627\\u0626\\u062f\\u0629 \\u060c \\u0648\\u062d\\u0633\\u0627\\u0628 \\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0636\\u0631\\u0627\\u0626\\u0628 \\u0648\\u0627\\u0644\\u0631\\u0633\\u0648\\u0645 \\u060c \\u0648\\u0625\\u0639\\u062f\\u0627\\u062f \\u0627\\u0644\\u0623\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u0648\\u0631\\u0642\\u064a\\u0629 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628\\u0629 \\u0644\\u0644\\u062a\\u062e\\u0644\\u064a\\u0635 \\u0627\\u0644\\u062c\\u0645\\u0631\\u0643\\u064a \\u0648\\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645 \\u0627\\u0644\\u0633\\u0644\\u0633. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062a\\u0639\\u0627\\u0645\\u0644 Cargo \\u0645\\u0639 \\u0627\\u0644\\u062a\\u062e\\u0644\\u064a\\u0635 \\u0627\\u0644\\u062c\\u0645\\u0631\\u0643\\u064a.\",\"bn\":\"\\u09ac\\u09bf\\u09b6\\u09cd\\u09ac\\u09ac\\u09cd\\u09af\\u09be\\u09aa\\u09c0, \\u09a8\\u09bf\\u09b0\\u09cd\\u09ac\\u09bf\\u0998\\u09cd\\u09a8\\u09c7 \\u09ac\\u09bf\\u0995\\u09cd\\u09b0\\u09bf \\u0995\\u09b0\\u09c7 \\u0986\\u09af\\u09bc \\u09ac\\u09be\\u09a1\\u09bc\\u09be\\u09a8\\u0964 \\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb \\u09a8\\u09c7\\u09a4\\u09c3\\u09b8\\u09cd\\u09a5\\u09be\\u09a8\\u09c0\\u09af\\u09bc \\u0986\\u09a8\\u09cd\\u09a4\\u09b0\\u09cd\\u099c\\u09be\\u09a4\\u09bf\\u0995 \\u0995\\u09c1\\u09b0\\u09bf\\u09af\\u09bc\\u09be\\u09b0\\u0997\\u09c1\\u09b2\\u09bf\\u09b0 \\u09b8\\u09be\\u09a5\\u09c7 \\u098f\\u0995\\u09c0\\u09ad\\u09c2\\u09a4 \\u09b9\\u09af\\u09bc\\u09c7, \\u099f\\u09cd\\u09af\\u09be\\u0995\\u09cd\\u09b8 \\u098f\\u09ac\\u0982 \\u09b6\\u09c1\\u09b2\\u09cd\\u0995 \\u0996\\u09b0\\u099a \\u0997\\u09a3\\u09a8\\u09be \\u0995\\u09b0\\u09c7 \\u098f\\u09ac\\u0982 \\u09ae\\u09b8\\u09c3\\u09a3 \\u09b6\\u09c1\\u09b2\\u09cd\\u0995 \\u099b\\u09be\\u09a1\\u09bc\\u09aa\\u09a4\\u09cd\\u09b0 \\u098f\\u09ac\\u0982 \\u09ac\\u09bf\\u09a4\\u09b0\\u09a3\\u09c7\\u09b0 \\u099c\\u09a8\\u09cd\\u09af \\u09b8\\u09a0\\u09bf\\u0995 \\u0995\\u09be\\u0997\\u099c\\u09aa\\u09a4\\u09cd\\u09b0 \\u09aa\\u09cd\\u09b0\\u09b8\\u09cd\\u09a4\\u09c1\\u09a4 \\u0995\\u09b0\\u09c7 \\u0995\\u09a0\\u09cb\\u09b0 \\u09aa\\u09b0\\u09bf\\u09b6\\u09cd\\u09b0\\u09ae \\u0995\\u09b0\\u09c7\\u0964 \\u099c\\u09be\\u09a8\\u09c1\\u09a8 \\u0995\\u09bf\\u09ad\\u09be\\u09ac\\u09c7 \\u0995\\u09be\\u09b0\\u09cd\\u0997\\u09cb \\u0995\\u09be\\u09b8\\u09cd\\u099f\\u09ae\\u09b8 \\u0995\\u09cd\\u09b2\\u09bf\\u09af\\u09bc\\u09be\\u09b0\\u09c7\\u09a8\\u09cd\\u09b8 \\u09aa\\u09b0\\u09bf\\u099a\\u09be\\u09b2\\u09a8\\u09be \\u0995\\u09b0\\u09c7\\u0964\",\"ru\":\"\\u0423\\u0432\\u0435\\u043b\\u0438\\u0447\\u044c\\u0442\\u0435 \\u0434\\u043e\\u0445\\u043e\\u0434, \\u043f\\u0440\\u043e\\u0434\\u0430\\u0432\\u0430\\u044f \\u043f\\u043e \\u0432\\u0441\\u0435\\u043c\\u0443 \\u043c\\u0438\\u0440\\u0443, \\u0431\\u0435\\u0437 \\u043f\\u0440\\u043e\\u0431\\u043b\\u0435\\u043c. Cargo \\u0432\\u044b\\u043f\\u043e\\u043b\\u043d\\u044f\\u0435\\u0442 \\u0442\\u044f\\u0436\\u0435\\u043b\\u0443\\u044e \\u0440\\u0430\\u0431\\u043e\\u0442\\u0443, \\u0438\\u043d\\u0442\\u0435\\u0433\\u0440\\u0438\\u0440\\u0443\\u044f\\u0441\\u044c \\u0441 \\u0432\\u0435\\u0434\\u0443\\u0449\\u0438\\u043c\\u0438 \\u043c\\u0435\\u0436\\u0434\\u0443\\u043d\\u0430\\u0440\\u043e\\u0434\\u043d\\u044b\\u043c\\u0438 \\u043a\\u0443\\u0440\\u044c\\u0435\\u0440\\u0441\\u043a\\u0438\\u043c\\u0438 \\u0441\\u043b\\u0443\\u0436\\u0431\\u0430\\u043c\\u0438, \\u0440\\u0430\\u0441\\u0441\\u0447\\u0438\\u0442\\u044b\\u0432\\u0430\\u044f \\u0440\\u0430\\u0441\\u0445\\u043e\\u0434\\u044b \\u043d\\u0430 \\u043d\\u0430\\u043b\\u043e\\u0433\\u0438 \\u0438 \\u043f\\u043e\\u0448\\u043b\\u0438\\u043d\\u044b \\u0438 \\u043f\\u043e\\u0434\\u0433\\u043e\\u0442\\u0430\\u0432\\u043b\\u0438\\u0432\\u0430\\u044f \\u043d\\u0435\\u043e\\u0431\\u0445\\u043e\\u0434\\u0438\\u043c\\u044b\\u0435 \\u0434\\u043e\\u043a\\u0443\\u043c\\u0435\\u043d\\u0442\\u044b \\u0434\\u043b\\u044f \\u0431\\u0435\\u0441\\u043f\\u0440\\u0435\\u043f\\u044f\\u0442\\u0441\\u0442\\u0432\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u0442\\u0430\\u043c\\u043e\\u0436\\u0435\\u043d\\u043d\\u043e\\u0433\\u043e \\u043e\\u0444\\u043e\\u0440\\u043c\\u043b\\u0435\\u043d\\u0438\\u044f \\u0438 \\u0434\\u043e\\u0441\\u0442\\u0430\\u0432\\u043a\\u0438. \\u0423\\u0437\\u043d\\u0430\\u0439\\u0442\\u0435, \\u043a\\u0430\\u043a Cargo \\u0437\\u0430\\u043d\\u0438\\u043c\\u0430\\u0435\\u0442\\u0441\\u044f \\u0442\\u0430\\u043c\\u043e\\u0436\\u0435\\u043d\\u043d\\u044b\\u043c \\u043e\\u0444\\u043e\\u0440\\u043c\\u043b\\u0435\\u043d\\u0438\\u0435\\u043c.\",\"es\":\"Aumente los ingresos vendiendo en todo el mundo, sin problemas. Cargo hace el trabajo duro al integrarse con los principales mensajeros internacionales, calcular los costos de impuestos y aranceles y preparar la documentaci\\u00f3n adecuada para el despacho de aduanas y la entrega sin problemas. Conozca c\\u00f3mo Cargo maneja el despacho de aduanas.\",\"zh\":\"\\u901a\\u8fc7\\u5728\\u5168\\u7403\\u8303\\u56f4\\u5185\\u65e0\\u7f1d\\u9500\\u552e\\u6765\\u589e\\u52a0\\u6536\\u5165\\u3002 \\u8d27\\u8fd0\\u901a\\u8fc7\\u4e0e\\u9886\\u5148\\u7684\\u56fd\\u9645\\u5feb\\u9012\\u516c\\u53f8\\u6574\\u5408\\u3001\\u8ba1\\u7b97\\u7a0e\\u6536\\u548c\\u5173\\u7a0e\\u6210\\u672c\\u4ee5\\u53ca\\u51c6\\u5907\\u6b63\\u786e\\u7684\\u6587\\u4e66\\u5de5\\u4f5c\\u4ee5\\u987a\\u5229\\u6e05\\u5173\\u548c\\u4ea4\\u4ed8\\u6765\\u5b8c\\u6210\\u8270\\u82e6\\u7684\\u5de5\\u4f5c\\u3002 \\u4e86\\u89e3 Cargo \\u5982\\u4f55\\u5904\\u7406\\u6e05\\u5173\\u3002\"}}', 'info', 'homepage', NULL, 15, 'easyship', 3, '2022-04-28 15:56:23', '2022-06-13 15:03:08'),
(8, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"start\",\"section_title\":{\"en\":\"Improve Your Store. No Coding Necessary.\",\"ger\":\"Verbessern Sie Ihren Shop. Keine Codierung erforderlich.\",\"fr\":\"Am\\u00e9liorez votre magasin. Aucun codage n\\u00e9cessaire.\",\"tr\":\"Ma\\u011fazan\\u0131z\\u0131 Geli\\u015ftirin. Kodlama Gerekmez.\",\"pt\":\"Melhore sua loja. Nenhuma Codifica\\u00e7\\u00e3o Necess\\u00e1ria.\",\"ar\":\"\\u062a\\u062d\\u0633\\u064a\\u0646 \\u0634\\u0631\\u0643\\u062a\\u0643. \\u0644\\u0627 \\u062d\\u0627\\u062c\\u0629 \\u0644\\u0644\\u0628\\u0631\\u0645\\u062c\\u0629 \\u0628\\u0646\\u0641\\u0633\\u0643.\",\"bn\":\"\\u0986\\u09aa\\u09a8\\u09be\\u09b0 \\u09a6\\u09cb\\u0995\\u09be\\u09a8 \\u0989\\u09a8\\u09cd\\u09a8\\u09a4. \\u0995\\u09cb\\u09a8 \\u0995\\u09cb\\u09a1\\u09bf\\u0982 \\u09aa\\u09cd\\u09b0\\u09af\\u09bc\\u09cb\\u099c\\u09a8\\u09c0\\u09af\\u09bc.\",\"ru\":\"\\u0423\\u043b\\u0443\\u0447\\u0448\\u0438\\u0442\\u0435 \\u0441\\u0432\\u043e\\u0439 \\u043c\\u0430\\u0433\\u0430\\u0437\\u0438\\u043d. \\u041a\\u043e\\u0434\\u0438\\u0440\\u043e\\u0432\\u0430\\u043d\\u0438\\u0435 \\u043d\\u0435 \\u0442\\u0440\\u0435\\u0431\\u0443\\u0435\\u0442\\u0441\\u044f.\",\"es\":\"Mejora tu tienda. No es necesaria la codificaci\\u00f3n.\",\"zh\":\"\\u6539\\u5584\\u60a8\\u7684\\u5546\\u5e97\\u3002 \\u65e0\\u9700\\u7f16\\u7801\\u3002\"},\"section_description\":{\"en\":\"Increase checkout conversion rates with dynamic rates at checkout. Show the best selection of couriers, in addition to delivery times and fully landed costs. Learn how checkout drives conversions. Cargo is seamlessly integrated with leading eCommerce platforms and marketplaces. You can manage all your shipments without writing a single line of code. See our integrated platforms.\",\"ger\":\"Erh\\u00f6hen Sie die Konversionsraten an der Kasse mit dynamischen Raten an der Kasse. Zeigen Sie die beste Auswahl an Kurieren, zus\\u00e4tzlich zu Lieferzeiten und vollst\\u00e4ndig angelieferten Kosten. Erfahren Sie, wie der Checkout Conversions f\\u00f6rdert. Cargo ist nahtlos in f\\u00fchrende E-Commerce-Plattformen und Marktpl\\u00e4tze integriert. Sie k\\u00f6nnen alle Ihre Sendungen verwalten, ohne eine einzige Codezeile schreiben zu m\\u00fcssen. Sehen Sie sich unsere integrierten Plattformen an.\",\"fr\":\"Augmentez les taux de conversion de paiement avec des taux dynamiques \\u00e0 la caisse. Affichez la meilleure s\\u00e9lection de coursiers, en plus des d\\u00e9lais de livraison et des co\\u00fbts complets. D\\u00e9couvrez comment le paiement g\\u00e9n\\u00e8re des conversions. Cargo est parfaitement int\\u00e9gr\\u00e9 aux principales plateformes et places de march\\u00e9 de commerce \\u00e9lectronique. Vous pouvez g\\u00e9rer tous vos envois sans \\u00e9crire une seule ligne de code. Voir nos plateformes int\\u00e9gr\\u00e9es.\",\"tr\":\"\\u00d6deme s\\u0131ras\\u0131nda dinamik oranlarla \\u00f6deme d\\u00f6n\\u00fc\\u015f\\u00fcm oranlar\\u0131n\\u0131 art\\u0131r\\u0131n. Teslimat s\\u00fcreleri ve tam teslimat maliyetlerine ek olarak en iyi kurye se\\u00e7imini g\\u00f6sterin. \\u00d6deme i\\u015fleminin d\\u00f6n\\u00fc\\u015f\\u00fcmleri nas\\u0131l sa\\u011flad\\u0131\\u011f\\u0131n\\u0131 \\u00f6\\u011frenin. Kargo, \\u00f6nde gelen e-ticaret platformlar\\u0131 ve pazar yerleriyle sorunsuz bir \\u015fekilde entegre edilmi\\u015ftir. Tek sat\\u0131r kod yazmadan t\\u00fcm g\\u00f6nderilerinizi y\\u00f6netebilirsiniz. Entegre platformlar\\u0131m\\u0131za bak\\u0131n.\",\"pt\":\"Aumente as taxas de convers\\u00e3o de checkout com taxas din\\u00e2micas no checkout. Mostre a melhor sele\\u00e7\\u00e3o de correios, al\\u00e9m de prazos de entrega e custos de desembarque completos. Saiba como o checkout gera convers\\u00f5es. O Cargo \\u00e9 perfeitamente integrado \\u00e0s principais plataformas e mercados de com\\u00e9rcio eletr\\u00f4nico. Voc\\u00ea pode gerenciar todas as suas remessas sem escrever uma \\u00fanica linha de c\\u00f3digo. Veja nossas plataformas integradas.\",\"ar\":\"\\u0642\\u0645 \\u0628\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0645\\u0639\\u062f\\u0644\\u0627\\u062a \\u062a\\u062d\\u0648\\u064a\\u0644 \\u0627\\u0644\\u0633\\u062f\\u0627\\u062f \\u0628\\u0645\\u0639\\u062f\\u0644\\u0627\\u062a \\u062f\\u064a\\u0646\\u0627\\u0645\\u064a\\u0643\\u064a\\u0629 \\u0639\\u0646\\u062f \\u0627\\u0644\\u0633\\u062f\\u0627\\u062f. \\u0639\\u0631\\u0636 \\u0623\\u0641\\u0636\\u0644 \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644 \\u060c \\u0628\\u0627\\u0644\\u0625\\u0636\\u0627\\u0641\\u0629 \\u0625\\u0644\\u0649 \\u0623\\u0648\\u0642\\u0627\\u062a \\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645 \\u0648\\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0628\\u0627\\u0644\\u0643\\u0627\\u0645\\u0644. \\u062a\\u0639\\u0631\\u0641 \\u0639\\u0644\\u0649 \\u0643\\u064a\\u0641\\u064a\\u0629 \\u062f\\u0641\\u0639 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0644\\u0644\\u062a\\u062d\\u0648\\u064a\\u0644\\u0627\\u062a. \\u062a\\u062a\\u0643\\u0627\\u0645\\u0644 Cargo \\u0628\\u0633\\u0644\\u0627\\u0633\\u0629 \\u0645\\u0639 \\u0645\\u0646\\u0635\\u0627\\u062a \\u0648\\u0623\\u0633\\u0648\\u0627\\u0642 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0627\\u0644\\u0631\\u0627\\u0626\\u062f\\u0629. \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0634\\u062d\\u0646\\u0627\\u062a \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643 \\u062f\\u0648\\u0646 \\u0643\\u062a\\u0627\\u0628\\u0629 \\u0633\\u0637\\u0631 \\u0648\\u0627\\u062d\\u062f \\u0645\\u0646 \\u0627\\u0644\\u062a\\u0639\\u0644\\u064a\\u0645\\u0627\\u062a \\u0627\\u0644\\u0628\\u0631\\u0645\\u062c\\u064a\\u0629. \\u0634\\u0627\\u0647\\